import "./App.css";
import TextFields from "./components/Log";
import Register from "./components/Reg";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<TextFields />} />
      </Routes>
    </Router>
  );
}

export default App;
